              cName : 'd-block w-100',
              src : 'image1',
              alt : 'First slide'
            },
      caption : ''
    },
    {
      item : {
              cName : 'd-block w-100',
              src : 'image2',
              alt : 'Second slide'
            },
      caption : ''
    },
    {
    item : {
            cName : 'd-block w-100',
            src : 'image3',
            alt : 'Third slide'
          },
    caption : ''
    }
]
